$(function(){$("#datePicker").datetimepicker(Core.dateTimePickerDateOptions)});const App=new Vue({el:"#app",data:function(){return{stations:[],variables:[],model:{stationId:201,variableId:1,date:null,isMetricUnits:!1}}},created:function(){Core.populateStationDropdown(this,!1);Core.populateVariableDropdown(this);this.createGraph();let t=window.location.search.substring(1),n=new URLSearchParams(t);console.log(n.get("id"));this.model.id=Number(n.get("id"));this.model.variableId=Number(n.get("varId"));this.model.date=Date(n.get("date"))},methods:{search:function(){this.createGraph()},createGraph:function(){const n=this;axios.get("/data/StationGraph",{params:{stationId:n.model.stationId,variableId:n.model.variableId,date:n.model.date,isMetricUnits:n.model.isMetricUnits}}).then(function(t){const i=t.data;n.model.date==null&&(n.model.date=moment(i.lastDateTimeEntry).format("MM/DD/YYYY"));Highcharts.chart("graph",{chart:{zoomType:"x",type:"line"},title:{text:i.title},tooltip:{valueDecimals:2},xAxis:{type:"datetime",title:{text:i.xAxisTitle}},yAxis:{type:"linear",title:{text:i.yAxisTitle}},series:i.series,exporting:{buttons:{contextButton:{menuItems:["viewFullscreen","separator","downloadPNG","downloadJPEG","downloadSVG"]}}}})}).catch(function(n){console.log("StationGraphInit failed",n)})}}});